s2n-tls organizes errors into different "types" to allow applications to handle error values without catching all possibilities. Applications using non-blocking I/O should check the error type to determine if the I/O operation failed because it would block or for some other error. To retrieve the type for a given error use s2n_error_get_type(). Applications should perform any error handling logic using these high level types: Here's an example that handles errors based on type: #define SUCCESS 0
#define FAILURE 1
#define RETRY 2 s2n_errno = S2N_ERR_T_OK;
if (s2n_negotiate(conn, &blocked) < 0) { switch(s2n_error_get_type(s2n_errno)) { case S2N_ERR_T_BLOCKED: /* Blocked, come back later */ return RETRY; case S2N_ERR_T_CLOSED: return SUCCESS; case S2N_ERR_T_IO: handle_io_err(errno); return FAILURE; case S2N_ERR_T_PROTO: handle_proto_err(); return FAILURE; case S2N_ERR_T_ALERT: log_alert(s2n_connection_get_alert(conn)); return FAILURE; /* Everything else */ default: log_other_error(); return FAILURE; }
}

