By default, a server chooses the first identity in its PSK list that also appears in the client's PSK list. The s2n_psk_selection_callback is available if you would like to implement your own PSK selection logic. Currently, this callback is not asynchronous. Call s2n_config_set_psk_selection_callback() to associate your s2n_psk_selection_callback with a config. The s2n_psk_selection_callback will provide the list of PSK identities sent by the client in the psk_list input parameter. You will need to create an offered PSK object by calling s2n_offered_psk_new() and pass this object as a parameter in s2n_offered_psk_list_next() in order to populate the offered PSK object. Call s2n_offered_psk_list_has_next() prior to calling s2n_offered_psk_list_next() to determine if there exists another PSK in the psk_list . Call s2n_offered_psk_get_identity() to get the identity of a particular s2n_offered_psk . Call s2n_offered_psk_list_choose_psk() to choose a particular s2n_offered_psk to be used for the connection. Note that the server must have already configured the corresponding PSK on the connection using s2n_connection_append_psk(). To disable PSKs for the connection and perform a full handshake instead, set the PSK identity to NULL. Call s2n_offered_psk_free() once you have chosen a particular PSK to free the memory allocated. If desired, s2n_offered_psk_list_reread() returns the offered PSK list to its original read state. After s2n_offered_psk_list_reread() is called, the next call to s2n_offered_psk_list_next() will return the first PSK in the offered PSK list. Use s2n_connection_get_negotiated_psk_identity() to retrieve the PSK identity selected by the server for the connection. In the following example, s2n_psk_selection_callback chooses the first client offered PSK identity present in an external store. int s2n_psk_selection_callback(struct s2n_connection *conn, void *context, struct s2n_offered_psk_list *psk_list)
{ struct s2n_offered_psk *offered_psk = s2n_offered_psk_new(); while (s2n_offered_psk_list_has_next(psk_list)) { uint8_t *client_psk_id = NULL; uint16_t client_psk_id_len = 0; s2n_offered_psk_list_next(psk_list, offered_psk); s2n_offered_psk_get_identity(offered_psk, &client_psk_id, &client_psk_id_len); struct s2n_psk *psk = user_lookup_identity_db(client_psk_id, client_psk_id_len); if (psk) { s2n_connection_append_psk(conn, psk); s2n_offered_psk_list_choose_psk(psk_list, offered_psk); break; } } s2n_offered_psk_free(&offered_psk); return S2N_SUCCESS;
}

