To send early data, your application should call s2n_send_early_data() before it calls s2n_negotiate(). s2n_connection_get_remaining_early_data_size() can be called to check how much more early data the client is allowed to send. If s2n_send_early_data() exceeds the allowed maximum, s2n-tls returns a usage error. Like other IO functions, s2n_send_early_data() can potentially fail repeatedly with a blocking error before it eventually succeeds: see I/O Functions for more information. An application can stop calling s2n_send_early_data() at any time, even if the function has not returned success yet. If s2n_send_early_data() does return success, the connection is ready to complete the handshake and begin sending normal data. However, s2n_send_early_data() can continue to be called to send more early data if desired. Once a client finishes sending early data, you should call s2n_negotiate() to complete the handshake just as you would for a handshake that did not include early data. For example: uint8_t early_data[] = "early data to send";
ssize_t total_data_sent = 0, len = sizeof(early_data);
while (total_data_sent < len) { ssize_t data_sent = 0; int r = s2n_send_early_data(client_conn, early_data + total_data_sent, len - total_data_sent, &data_sent, &blocked); total_data_sent += data_sent; if (r == S2N_SUCCESS) { break; } else if (s2n_error_get_type(s2n_errno) != S2N_ERR_T_BLOCKED) { exit(1); }
}
while (s2n_negotiate(client_conn, &blocked) != S2N_SUCCESS) { if (s2n_error_get_type(s2n_errno) != S2N_ERR_T_BLOCKED) { exit(1); }
}

