To receive early data, your application should call s2n_recv_early_data() before it calls s2n_negotiate(). Like other S2N IO functions, s2n_recv_early_data() can potentially fail repeatedly with a blocking error before it eventually succeeds: see I/O Functions for more information. Once s2n_recv_early_data() has been called, it must be called until it returns success. If an application stops calling s2n_recv_early_data() early, some early data may be left unread and cause later calls to s2n_negotiate() to return fatal errors. Calling s2n_recv_early_data() again after it returns success is possible but has no effect on the connection. Once a server has read all early data, you should call s2n_negotiate() to complete the handshake just as you would for a handshake that did not include early data. For example: uint8_t early_data[MAX_EARLY_DATA] = { 0 };
ssize_t total_data_recv = 0, data_recv = 0;
while (s2n_recv_early_data(conn, early_data + total_data_recv, MAX_EARLY_DATA - total_data_recv, &data_recv, &blocked) != S2N_SUCCESS) { total_data_recv += data_recv; if (s2n_error_get_type(s2n_errno) != S2N_ERR_T_BLOCKED) { exit(1); }
}
while (s2n_negotiate(conn, &blocked) != S2N_SUCCESS) { if (s2n_error_get_type(s2n_errno) != S2N_ERR_T_BLOCKED) { exit(1); }
}

