s2n-tls does not include anti-replay protection automatically. Effective anti-replay protection for a multi-server application requires an external state shared by all servers. Without shared state, an attacker can capture early data originally sent to server A and successfully replay it against server B. The TLS1.3 specification suggests two possible anti-replay solutions that a user can implement: Single-Use Tickets : Valid tickets are stored in a shared database and deleted after use. s2n_connection_get_negotiated_psk_identity_length() and s2n_connection_get_negotiated_psk_identity() can be used to get the ticket identifier, or "pre-shared key identity", associated with offered early data. Client Hello Recording : Instead of recording outstanding valid tickets, unique values from recent ClientHellos can be stored. The client hello message can be retrieved with s2n_connection_get_client_hello() and the pre-shared key identity can be retrieved with s2n_connection_get_negotiated_psk_identity_length() and s2n_connection_get_negotiated_psk_identity(), but s2n-tls does not currently provide methods to retrieve the validated binders or the ClientHello.random. The s2n_early_data_cb() can be used to hook an anti-replay solution into s2n-tls. The callback can be configured by using s2n_config_set_early_data_cb(). Using the s2n_offered_early_data pointer offered by the callback, s2n_offered_early_data_reject() or s2n_offered_early_data_accept() can accept or reject the client request to use early data. An example implementation: int s2n_early_data_cb_impl(struct s2n_connection *conn, struct s2n_offered_early_data *early_data)
{ uint16_t identity_size = 0; s2n_connection_get_negotiated_psk_identity_length(conn, &identity_size); uint8_t *identity = malloc(identity_size); s2n_connection_get_negotiated_psk_identity(conn, identity, identity_size); if (user_verify_single_use_ticket(identity)) { s2n_offered_early_data_accept(early_data); } else { s2n_offered_early_data_reject(early_data); } free(identity); return S2N_SUCCESS;
} The callback can also be implemented asynchronously by returning S2N_SUCCESS without either accepting or rejecting the early data. The handshake will then fail with an S2N_ERR_T_BLOCKED error type and s2n_blocked_status set to S2N_BLOCKED_ON_APPLICATION_INPUT until s2n_offered_early_data_reject() or s2n_offered_early_data_accept() is called asynchronously. An example asynchronous implementation: void *user_accept_or_reject_early_data(void *arg)
{ struct s2n_offered_early_data *early_data = (struct s2n_offered_early_data *) arg; if (user_slowly_verify_early_data(early_data)) { s2n_offered_early_data_accept(early_data); } else { s2n_offered_early_data_reject(early_data); } return NULL;
} int s2n_early_data_cb_async_impl(struct s2n_connection *conn, struct s2n_offered_early_data *early_data)
{ pthread_t thread_id; pthread_create(&thread_id, NULL, user_accept_or_reject_early_data, (void *) early_data); return S2N_SUCCESS;
} s2n_offered_early_data_get_context_length() and s2n_offered_early_data_get_context() can be called to examine the optional user context associated with the early data. Unlike most s2n-tls callbacks, the context is not configured when the callback is set. Instead, the context is associated with the specific pre-shared key or session ticket used for early data. The context can be set for external pre-shared keys by calling s2n_psk_set_early_data_context(). For session tickets, s2n_connection_set_server_early_data_context() can be used to set the context the server includes on its new session tickets. Because the server needs to serialize the context when creating a new session ticket, the context is a byte buffer instead of the usual void pointer.
